import './App.css';

// Routes
import  { BrowserRouter, Routes, Route, Navigate } from "react-router-dom"

// Pages
import Home from './pages/Home/Home';
import Login from './pages/Path/Login';
import Register from './pages/Path/Register';

function App() {
  return (
    <div className="app">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={Home} />
        <Route path="/login" element={Login} />
        <Route path="/Register" element={Register} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
